import React from "react";
import Header from './Layout/AppHeader';
import Footer from './Layout/AppFooter';
import SearchFilter from "./SearchFilter";

const Home = () => {
    return (
        <>
            <Header />
            <SearchFilter />
            <img class="w-24 h-24 mb-3 rounded-full shadow-lg" src="../Assets/bgImage.jpg" alt="Bonnie image"/>
            <Footer />
        </>
    )
}

export default Home;
